// src/utils/levenshteinMethods.ts
var truncateAfterNewline = (str) => {
  const newlineIndex = str.indexOf("\n");
  if (newlineIndex !== -1) {
    return str.substring(0, newlineIndex);
  } else {
    return str;
  }
};
var calculateLevenshteinDistance = (str1, str2) => {
  const m = str1.length;
  const n = str2.length;
  if (Math.abs(m - n) > 2) {
    return Infinity;
  }
  const dp = [];
  for (let i = 0; i <= m; i++) {
    dp[i] = [i];
  }
  for (let j = 1; j <= n; j++) {
    dp[0][j] = j;
  }
  for (let i = 1; i <= m; i++) {
    for (let j = 1; j <= n; j++) {
      if (str1[i - 1] === str2[j - 1]) {
        dp[i][j] = dp[i - 1][j - 1];
      } else {
        dp[i][j] = Math.min(
          dp[i - 1][j] + 1,
          // deletion
          dp[i][j - 1] + 1,
          // insertion
          dp[i - 1][j - 1] + 1
          // substitution
        );
      }
    }
  }
  return dp[m][n];
};
